import { RouteMain as Routes } from "./Routes";
import { Global } from "./styles/global";
import { useState } from "react";
import { Providers } from "./Contexts/UserContext";
function App() {
  const [user, setUser] = useState([]);
  return (
    <>
      <Global />
      <Providers>
        <Routes setUser={setUser} user={user} />
      </Providers>
    </>
  );
}

export default App;
